import { Route, Switch, Redirect } from "react-router-dom";
import QuoteForm from "./components/quotes/QuoteForm";
import Comments from "./components/comments/Comments";
import NewCommentForm from "./components/comments/NewCommentForm";

function App() {
  return (
    <div>
      <header></header>
      <main>
        <Switch>
          <Route path="/" exact>
            <Redirect to="/quotes" />
          </Route>
          <Route path="/quotes">
            <QuoteForm />
          </Route>
          <Route path="/quotes/:quouteId">
            <Comments />
          </Route>
          <Route path="/new-comment-form">
            <NewCommentForm />
          </Route>
        </Switch>
      </main>
    </div>
  );
}

export default App;
